import React from 'react';
import Map from '../map/map'
import Map3D from '../map/map3d';

class Index extends React.Component {
  render() {
    return <>
      <span className="App">
        <Map/>
      </span>
      <span className="nice">
        <Map3D/>
      </span>
    </>
  }
}

export default Index;
